INSERT INTO `v1_9229f9b0566df6b6d6f1b32ece767a21ac8b8f755d8bd32cbe7aada94ac7e068` VALUES (401, 24001, 24, 0.0, 102301, "やったね、ぷうきち！\nこれならお兄ちゃんたちの\nお手本になれたよね！", 2, 2, "2020/07/31 12:00:00", "2030/12/17 14:59:59", "アヤネ", 0.0, 10046, 0.0);
INSERT INTO `v1_9229f9b0566df6b6d6f1b32ece767a21ac8b8f755d8bd32cbe7aada94ac7e068` VALUES (402, 24002, 24, 0.0, 102301, "私たちの勝ちだね！\nぷうきちと一緒なら\nどんなボールでも\nホームランを打ってみせるよ！", 1, 2, "2020/07/31 12:00:00", "2030/12/17 14:59:59", "アヤネ", 2.21, 10046, 0.0);
INSERT INTO `v1_9229f9b0566df6b6d6f1b32ece767a21ac8b8f755d8bd32cbe7aada94ac7e068` VALUES (403, 24003, 24, 0.0, 102301, "やったやったぁ！\nお兄ちゃん、見ててくれた？\n私、すっごくがんばったよ！", 2, 2, "2020/07/31 12:00:00", "2030/12/17 14:59:59", "アヤネ", 0.0, 10046, 0.0);
INSERT INTO `v1_9229f9b0566df6b6d6f1b32ece767a21ac8b8f755d8bd32cbe7aada94ac7e068` VALUES (701, 24004, 24, 0.0, 192201, "特訓の成果が出たみたいだ！\nもっと練習を重ねて\nこの調子で上達していこう！", 2, 1, "2020/07/31 12:00:00", "2030/12/17 14:59:59", "アサヒ", 1.99, 10046, 0.0);
INSERT INTO `v1_9229f9b0566df6b6d6f1b32ece767a21ac8b8f755d8bd32cbe7aada94ac7e068` VALUES (702, 24005, 24, 0.0, 192201, "よし、いい感じだ！\nキャプテンとしての仕事は\nきっちり果たせそうだよ", 1, 2, "2020/07/31 12:00:00", "2030/12/17 14:59:59", "アサヒ", 2.21, 10046, 0.0);
INSERT INTO `v1_9229f9b0566df6b6d6f1b32ece767a21ac8b8f755d8bd32cbe7aada94ac7e068` VALUES (703, 24006, 24, 0.0, 192201, "試合に向けて\nいい感覚を掴めた気がするよ！\nこのまま一気に全国大会だ！", 2, 1, "2020/07/31 12:00:00", "2030/12/17 14:59:59", "アサヒ", 3.33, 10046, 0.0);
INSERT INTO `v1_9229f9b0566df6b6d6f1b32ece767a21ac8b8f755d8bd32cbe7aada94ac7e068` VALUES (801, 24007, 24, 0.0, 192301, "このくらい余裕だ\nオレたちは全国大会を\n目指してるんだからな", 2, 2, "2020/07/31 12:00:00", "2030/12/17 14:59:59", "部員３", 0.0, 10046, 0.0);
INSERT INTO `v1_9229f9b0566df6b6d6f1b32ece767a21ac8b8f755d8bd32cbe7aada94ac7e068` VALUES (802, 24008, 24, 0.0, 192301, "オレだって\nビーチベースボール選手だ\nどんな球だろうが\n全部スタンドまで飛ばしてやる", 1, 2, "2020/07/31 12:00:00", "2030/12/17 14:59:59", "部員３", 2.68, 10046, 0.0);
INSERT INTO `v1_9229f9b0566df6b6d6f1b32ece767a21ac8b8f755d8bd32cbe7aada94ac7e068` VALUES (803, 24009, 24, 0.0, 192301, "いい感じだ\nこれなら試合でも活躍できそうだ\n大暴れしてやる！", 2, 2, "2020/07/31 12:00:00", "2030/12/17 14:59:59", "部員３", 0.0, 10046, 0.0);
INSERT INTO `v1_9229f9b0566df6b6d6f1b32ece767a21ac8b8f755d8bd32cbe7aada94ac7e068` VALUES (501, 24010, 24, 0.0, 192501, "やった！", 1, 1, "2020/07/31 12:00:00", "2030/12/17 14:59:59", "", 0.0, 10046, 0.0);
INSERT INTO `v1_9229f9b0566df6b6d6f1b32ece767a21ac8b8f755d8bd32cbe7aada94ac7e068` VALUES (502, 24011, 24, 0.0, 192501, "勝ったよ！", 1, 1, "2020/07/31 12:00:00", "2030/12/17 14:59:59", "", 0.0, 10046, 0.0);
INSERT INTO `v1_9229f9b0566df6b6d6f1b32ece767a21ac8b8f755d8bd32cbe7aada94ac7e068` VALUES (503, 24012, 24, 0.0, 192501, "いい調子！", 1, 1, "2020/07/31 12:00:00", "2030/12/17 14:59:59", "", 0.0, 10046, 0.0);
INSERT INTO `v1_9229f9b0566df6b6d6f1b32ece767a21ac8b8f755d8bd32cbe7aada94ac7e068` VALUES (111, 24013, 24, 0.0, 113501, "あら～…もしかして\n勝っちゃったのかしら？\nみんなの練習を見ていたから\nかもしれないわね", 6, 2, "2020/07/31 12:00:00", "2030/12/17 14:59:59", "ミサト", 5.33, 10046, 0.0);
INSERT INTO `v1_9229f9b0566df6b6d6f1b32ece767a21ac8b8f755d8bd32cbe7aada94ac7e068` VALUES (112, 24014, 24, 0.0, 113501, "みんなの力になりたくて\n先生も頑張ってみました～！\nうまく投げられたみたいで\nよかったわ～！", 1, 2, "2020/07/31 12:00:00", "2030/12/17 14:59:59", "ミサト", 6.85, 10046, 0.0);
INSERT INTO `v1_9229f9b0566df6b6d6f1b32ece767a21ac8b8f755d8bd32cbe7aada94ac7e068` VALUES (113, 24015, 24, 0.0, 113501, "練習お疲れさま～！\n先生も協力できて\nとってもうれしいわ～♪\n次も頑張りましょうね～！", 1, 2, "2020/07/31 12:00:00", "2030/12/17 14:59:59", "ミサト", 3.0, 10046, 0.0);
INSERT INTO `v1_9229f9b0566df6b6d6f1b32ece767a21ac8b8f755d8bd32cbe7aada94ac7e068` VALUES (611, 24016, 24, 0.0, 192401, "まだ練習が足りねえみてえだな\nこれっぽっちも本気で\n投げてねえっつーの\nもう一回やんぞ！", 1, 2, "2020/07/31 12:00:00", "2030/12/17 14:59:59", "ダイチ", 6.11, 10046, 0.0);
INSERT INTO `v1_9229f9b0566df6b6d6f1b32ece767a21ac8b8f755d8bd32cbe7aada94ac7e068` VALUES (612, 24017, 24, 0.0, 192401, "ふん、当然の結果だな\n俺の球は、誰にも打てねえよ！\nまたやりてえっつーなら\nとことん付き合ってやるぜ！", 1, 2, "2020/07/31 12:00:00", "2030/12/17 14:59:59", "ダイチ", 6.75, 10046, 0.0);
INSERT INTO `v1_9229f9b0566df6b6d6f1b32ece767a21ac8b8f755d8bd32cbe7aada94ac7e068` VALUES (613, 24018, 24, 0.0, 192401, "おっしゃあ！\nこの勢いで全国に行ってやるぜ！\n全員三振で仕留めてやる！", 2, 2, "2020/07/31 12:00:00", "2030/12/17 14:59:59", "ダイチ", 0.0, 10046, 0.0);
INSERT INTO `v1_9229f9b0566df6b6d6f1b32ece767a21ac8b8f755d8bd32cbe7aada94ac7e068` VALUES (211, 24019, 24, 0.0, 113401, "きらーん☆\nハツネちゃんの大勝利なのだ～！\nみんながもっと上達できるように\n私もまだまだ頑張るからね！", 2, 1, "2020/07/31 12:00:00", "2030/12/17 14:59:59", "ハツネ", 4.52, 10046, 0.0);
INSERT INTO `v1_9229f9b0566df6b6d6f1b32ece767a21ac8b8f755d8bd32cbe7aada94ac7e068` VALUES (212, 24020, 24, 0.0, 113401, "やったあ！　私の勝ちだね！\nチアリーダーもピッチャーも\nハツネちゃんに任せてよ！", 2, 1, "2020/07/31 12:00:00", "2030/12/17 14:59:59", "ハツネ", 3.89, 10046, 0.0);
INSERT INTO `v1_9229f9b0566df6b6d6f1b32ece767a21ac8b8f755d8bd32cbe7aada94ac7e068` VALUES (213, 24021, 24, 0.0, 113401, "よお～し、この調子でもっと\n頑張ろう…と思ったけど\n超能力を使ったから…\n眠くなってきちゃった…すやぁ…", 1, 2, "2020/07/31 12:00:00", "2030/12/17 14:59:59", "ハツネ", 13.49, 10046, 0.0);
INSERT INTO `v1_9229f9b0566df6b6d6f1b32ece767a21ac8b8f755d8bd32cbe7aada94ac7e068` VALUES (311, 24022, 24, 0.0, 106501, "いい勝負だったぜ！\nたぎっちまって\nつい本気で投げちまったよ", 1, 2, "2020/07/31 12:00:00", "2030/12/17 14:59:59", "カヤ", 3.17, 10046, 0.0);
INSERT INTO `v1_9229f9b0566df6b6d6f1b32ece767a21ac8b8f755d8bd32cbe7aada94ac7e068` VALUES (312, 24023, 24, 0.0, 106501, "どうだ？\nオレ様のボールは熱かっただろ！\nま、でもおまえらの根性も\nなかなかのもんだったぜ", 1, 2, "2020/07/31 12:00:00", "2030/12/17 14:59:59", "カヤ", 4.42, 10046, 0.0);
INSERT INTO `v1_9229f9b0566df6b6d6f1b32ece767a21ac8b8f755d8bd32cbe7aada94ac7e068` VALUES (313, 24024, 24, 0.0, 106501, "なんだよ、そんなもんか？\nこっちはまだまだ投げたりねえ\nもっと勝負しようぜ！", 6, 1, "2020/07/31 12:00:00", "2030/12/17 14:59:59", "カヤ", 2.89, 10046, 0.0);
INSERT INTO `v1_9229f9b0566df6b6d6f1b32ece767a21ac8b8f755d8bd32cbe7aada94ac7e068` VALUES (421, 24025, 24, 0.0, 102301, "あとちょっとだったのに～！\n次こそぷうきちと一緒に\n勝ってみせるからね！", 4, 3, "2020/07/31 12:00:00", "2030/12/17 14:59:59", "アヤネ", 3.71, 10046, 0.0);
INSERT INTO `v1_9229f9b0566df6b6d6f1b32ece767a21ac8b8f755d8bd32cbe7aada94ac7e068` VALUES (721, 24026, 24, 0.0, 192201, "いい勝負だったね！\nでも、やっぱり悔しいな…\nもっと練習して\n今度は絶対に俺が勝つから！", 2, 1, "2020/07/31 12:00:00", "2030/12/17 14:59:59", "アサヒ", 5.1, 10046, 0.0);
INSERT INTO `v1_9229f9b0566df6b6d6f1b32ece767a21ac8b8f755d8bd32cbe7aada94ac7e068` VALUES (821, 24027, 24, 0.0, 192301, "ちっ…あと一歩足りなかったか\n次こそは絶対に勝つから\nそのつもりでいろ", 1, 3, "2020/07/31 12:00:00", "2030/12/17 14:59:59", "部員３", 4.34, 10046, 0.0);
INSERT INTO `v1_9229f9b0566df6b6d6f1b32ece767a21ac8b8f755d8bd32cbe7aada94ac7e068` VALUES (521, 24028, 24, 0.0, 192501, "いい勝負だったよ\nまたやろうね", 1, 1, "2020/07/31 12:00:00", "2030/12/17 14:59:59", "", 0.0, 10046, 0.0);
INSERT INTO `v1_9229f9b0566df6b6d6f1b32ece767a21ac8b8f755d8bd32cbe7aada94ac7e068` VALUES (101, 24029, 24, -360.0, 113501, "とってもよくできました～♪\n頑張ってくれて先生うれしいわ\nこれからも試合に向けて\n練習していきましょうね～", 1, 2, "2020/07/31 12:00:00", "2030/12/17 14:59:59", "ミサト", 5.62, 10046, 0.0);
INSERT INTO `v1_9229f9b0566df6b6d6f1b32ece767a21ac8b8f755d8bd32cbe7aada94ac7e068` VALUES (102, 24030, 24, -360.0, 113501, "頑張った成果ね～！\nこのまま練習を続ければ\nもっとすごい成績を残せそうよ\n期待してますからね～！", 1, 2, "2020/07/31 12:00:00", "2030/12/17 14:59:59", "ミサト", 9.58, 10046, 0.0);
INSERT INTO `v1_9229f9b0566df6b6d6f1b32ece767a21ac8b8f755d8bd32cbe7aada94ac7e068` VALUES (103, 24031, 24, -360.0, 113501, "いい子、いい子～♪\n頑張り屋さんのあなたを\nたっくさん褒めてあげますからね", 2, 2, "2020/07/31 12:00:00", "2030/12/17 14:59:59", "ミサト", 0.0, 10046, 0.0);
INSERT INTO `v1_9229f9b0566df6b6d6f1b32ece767a21ac8b8f755d8bd32cbe7aada94ac7e068` VALUES (104, 24032, 24, -360.0, 113501, "夢に向けて、一歩前進できたわね\nこの調子で、夢を叶えましょう\n目指せ、全国大会～！", 2, 1, "2020/07/31 12:00:00", "2030/12/17 14:59:59", "ミサト", 9.13, 10046, 0.0);
INSERT INTO `v1_9229f9b0566df6b6d6f1b32ece767a21ac8b8f755d8bd32cbe7aada94ac7e068` VALUES (105, 24033, 24, -360.0, 113501, "絶好調ね～♪\nきっと試合でも大活躍\n間違いなしだわ\n楽しみにしていますからね～！", 1, 2, "2020/07/31 12:00:00", "2030/12/17 14:59:59", "ミサト", 8.27, 10046, 0.0);
